import React from 'react'
import Navbar from '../components/Navbar/Navbar'
import Register from './Register';

function Home() {
    return (
        <div style={{ "backgroundImage": "url(https://images.unsplash.com/photo-1544377193-33dcf4d68fb5?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTJ8fGh1bWFuJTIwcmVzb3VyY2V8ZW58MHx8MHx8fDA%3D&auto=format&fit=crop&w=500&q=60)" }} >
            <Navbar />

            <Register />

        </div>)
}

export default Home;
